import React from "react";
import PropTypes from "prop-types";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemText from "@material-ui/core/ListItemText";
import Paper from "@material-ui/core/Paper";
import { parse } from "path";

const DateDisplay = props => (
  <Paper className="container">
    <List>
      <ListItem>
        <ListItemText>Day: {parseInt(props.apiResponse.slice(0, 2), 10)} </ListItemText>
      </ListItem>
      <ListItem>
        <ListItemText>Month: {parseInt(props.apiResponse.slice(3, 5))} </ListItemText>
      </ListItem>
      <ListItem>
        <ListItemText>Year: {props.apiResponse.slice(6, 10)} </ListItemText>
      </ListItem>
    </List>
  </Paper>
);

DateDisplay.propTypes = {
  apiResponse: PropTypes.string
};

export default DateDisplay;
